import React from "react";
import Resume_pdf from '../assets/Mehul_Jaiswal_Resume.pdf';


class Resume extends React.Component {
    render() {
        return (
            <section id="resume" className="resume-mf sect-pt4 route">
            <div className="container">
            <div className="row">
                <div className="col-sm-12">
                <div className="title-box text-center">
                    <h3 className="title-a">Resume</h3>
                    <p className="subtitle-a">
                        Please click on the button to view my Resume!
                    </p>
                    <div className="line-mf"></div>
                </div>
                </div>
            </div>
            </div>
            <a href={Resume_pdf} rel="noopener noreferrer" target="_blank">
                    <button>
                        PDF
                    </button>
                </a>
            </section>
        );
    }
}

export default Resume;
